import { Component } from '@angular/core';

@Component({
  selector: 'app-usertask-update',
  templateUrl: './usertask-update.component.html',
  styleUrls: ['./usertask-update.component.css']
})
export class UsertaskUpdateComponent {
  updateClicked = false;
  taskId:number;
  taskStatus:string;
  constructor(private http: HttpClient){}
  ngOnInit(): void {
  }
  updateTaskStatus()
  {  
 //  this.updateClicked = true;
     console.log("i am printing taskId");
     console.log(this.taskId);
     console.log(this.taskStatus);
     const token = JSON.parse(sessionStorage.getItem('key')).token;
     const headers = new HttpHeaders({
       'Authorization': `Bearer ${token}`
     });

     this.http.put('http://localhost:8083/api/task/status/'+this.taskId ,{ status: this.taskStatus }, { headers}).subscribe((response)=>{
      console.log(response);
    })
 }
}
